{"metadata":{"kernelspec":{"name":"ir","display_name":"R","language":"R"},"language_info":{"name":"R","codemirror_mode":"r","pygments_lexer":"r","mimetype":"text/x-r-source","file_extension":".r","version":"4.0.5"}},"nbformat_minor":4,"nbformat":4,"cells":[{"source":"<a href=\"https://www.kaggle.com/code/nurbekserzhanov/stat-l3-miage-human-life-expectancy-r-learning?scriptVersionId=91786928\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"cell_type":"code","source":"ploting_region <- function(data,title) {\n  ggplot(data, aes(x=Year, y=Expectancy, color=Region)) + \n  geom_line(size=1) + theme_ipsum() + labs(title=title)\n}\n\nploting_country <- function(data,title) {\n  ggplot(data, aes(x=Year, y=Expectancy, color=Country)) + \n  geom_line(size=1) + theme_ipsum() + labs(title=title)\n}\n\n#Tout d'abord, cette analyse se fait principalement à l'échelle mondiale. Dans certains points, pour une compréhension de base, les pays avec les valeurs d'espérance de vie les plus basses seront considérés comme des valeurs d'espérance de vie minimales dans le monde pour leur année respective. Il en est de même pour les valeurs d'espérance de vie maximale.\n\n#Les données ne contiennent aucune information sur le sexe. Si nous avions cela, nous pourrions faire d'autres hypothèses.\n\n#Nous allons explorer, nettoyer et ranger les données.\n\nlibrary(tidyverse)\nlibrary(dplyr)\ndf =   read_csv(\"../input/human-life-expectancy-around-the-world/Human_life_Expectancy.csv\")\n\nhead(df)\n\n#On voit que le data set n est pas bien representé alors on va le refactoriser en ajoutant nouvelle columne Year pour la valeur\n#On rassemble les années dans une seul colonne en montrant la esperance correspondante par chaque année\nlong_DF <- df%>%gather(Year, Expectancy , `1990`:`2019`)\nlong_DF\nglimpse(long_DF)\n\ncat(\"Est ce que on a des valeurs null? \",is.null(long_DF))# on a pas de valuer null mais selon la description de data notre null est indique comme not available\ncat(paste(\"\\nCombien de valeurs Not Available contient data set \"),sum(long_DF=='Not Available'))\ncat(paste(\"\\nLe pourcnetage de Not available sur notre data set \"),sum(long_DF=='Not Available')/nrow(long_DF)*100)\n\n\n\n\n\n\n#Certaines valeurs d'attente sont manquantes, indiquées comme \"Not Available\". \n#Et il existe des niveaux \"national\" et \"subnational\". \n#Nous travaillerons au niveau national. De plus, il n'y a pas de valeurs nulles. Nous supprimerons la colonne \"region\".\n#La colonne \"level\" peut être supprimée après le filtrage des données au niveau national. \n#Nous avons besoin d'autres colonnes dans notre analyse. Nous nous occuperons des types de données après tout nettoyage.\n\n\n\nglimpse(long_DF)\n\n\ndata_all_national=long_DF %>% filter(long_DF$Level=='National')\ndata_all_national = select(data_all_national,-4)\n\nsummary(data_all_national)\nglimpse(data_all_national)\n#Dealing with Not Available\n\ncat(paste(\"\\nCombien de valeurs Not Available contient data set \"),sum(data_all_national=='Not Available'))","metadata":{"execution":{"iopub.status.busy":"2022-03-31T20:28:36.481327Z","iopub.execute_input":"2022-03-31T20:28:36.483754Z","iopub.status.idle":"2022-03-31T20:28:38.358821Z"},"trusted":true},"execution_count":1,"outputs":[{"name":"stderr","text":"── \u001b[1mAttaching packages\u001b[22m ─────────────────────────────────────── tidyverse 1.3.1 ──\n\n\u001b[32m✔\u001b[39m \u001b[34mggplot2\u001b[39m 3.3.5     \u001b[32m✔\u001b[39m \u001b[34mpurrr  \u001b[39m 0.3.4\n\u001b[32m✔\u001b[39m \u001b[34mtibble \u001b[39m 3.1.5     \u001b[32m✔\u001b[39m \u001b[34mdplyr  \u001b[39m 1.0.7\n\u001b[32m✔\u001b[39m \u001b[34mtidyr  \u001b[39m 1.1.4     \u001b[32m✔\u001b[39m \u001b[34mstringr\u001b[39m 1.4.0\n\u001b[32m✔\u001b[39m \u001b[34mreadr  \u001b[39m 2.0.2     \u001b[32m✔\u001b[39m \u00